import { StyleSheet } from 'react-native';
import Theme from '../../styles/colors';

export default StyleSheet.create({
  slider: {
    opacity: 1,
    height: 50,
    marginRight: 50,
    marginLeft: 0,
    paddingBottom: 30,
  },
  text: {
    fontSize: 20,
    textAlign: 'center',
    color: Theme.text,
  },
});
